import React from 'react'
const ThreeD = () => {
  return (
    <>      
      <div className="sketchfab-embed-wrapper">
        <iframe title="A 3D model" width="100%" src="https://sketchfab.com/models/d63ed94f50f04aac98c820f2fc190b8b/embed?autostart=0&amp;ui_controls=0&amp;ui_infos=0&amp;ui_inspector=0&amp;ui_stop=0&amp;ui_watermark=0&amp;ui_watermark_link=0" frameborder="0" allow="autoplay; fullscreen; vr" mozallowfullscreen="true" webkitallowfullscreen="true"></iframe>
      </div>
    </>
  )
}

export default ThreeD
